  name: deepin runtime
  kind: runtime
  version: 23.1.0.1
  description: |
    Qt is a cross-platform C++ application framework. Qt's primary feature
    is its rich set of widgets that provide standard GUI functionality.

base: org.deepin.base/23.1.0
modules:
  - name: unuse
    files: |
      ^/lib/x86_64-linux-gnu/.+\.a$
      ^/lib//llvm-16/.+
      ^/include/.+
      ^/share/fonts/.+
